import React from 'react'
import { v4 as uuidv4 } from 'uuid';

const users=[
    {
        'name': 'akash',
         'age': 27,
         "phone":[
               {
                'home': '44555',
                 'office':'5522'
               }
         ]
    }
]


function List() {
  return (
    <div>
        {users.map((user, index)=>{
            const {name,age} = user;
            return(
                <div key={index}>
                    <h1>{name}</h1>
                    <h1>{age}</h1>
                    {user.phone.map((phn,index)=>{
                        const {home,office} = phn;
                        return(
                            <div key = {index}>
                                <h1>{home}</h1>
                                <h1>{office}</h1>
                            </div>
                        )
                    })}
                </div>
            )
        })}
    </div>
  )
}

export default List
